import React, { Component } from 'react'
import Card from 'react-bootstrap/Card';
class Rating extends Component {

    constructor(props) {
        super(props);
        this.state = {
            description: props.children,
            value: props.value
        }
        this.saveCriterion = this.saveCriterion.bind(this);
    }
    render() {
        return (
            <div>
                <Card style={{ width: '18rem' }}>
                    <Card.Header><input type="text" placeholder="name" name="name" className="form-control" value={props.children} onChange={this.onChange} /></Card.Header>
                    <Card.Text>{props.value}</Card.Text>
                </Card>
            </div>
        )
    }
}
export default Rating;
